import { Component, OnInit } from '@angular/core';
import { ProjectService } from '../services/project.service';
import { ActivatedRoute, Router } from '@angular/router';
import { catchError, Observable, of } from 'rxjs';
import { ErrorDialogComponent } from 'src/app/shared/components/error-dialog/error-dialog.component';
import { MatDialog } from '@angular/material/dialog';
import { AppComponent } from 'src/app/app.component';
import { FormBuilder, FormGroup } from '@angular/forms';
import { Project } from '../model/project';
import { MatSnackBar } from '@angular/material/snack-bar';
@Component({
  selector: 'app-project',
  templateUrl: './project.component.html',
  styleUrls: ['./project.component.scss']
})
export class ProjectComponent implements OnInit {
  displayedColumns = ['name', 'description','updatedAt','createdAt','actions'];
  projetos: any;
  constructor(
    private projeto: ProjectService,
    private router:Router,
    private route: ActivatedRoute,
    public dialog: MatDialog,
    public app :AppComponent,
    private formBuilder: FormBuilder,
    private snackBar: MatSnackBar,)
  {
    {
      this.projeto
        .list()
        .pipe(
          catchError((error) => {
            this.onErro('Erro ao carregar. ');
            return of([]);
          })
        )
        .subscribe((projetos) => {
          this.projetos = Array.isArray(projetos) ? projetos : [projetos];
        });
    }




  }

  ngOnInit(): void {


  }

  onErro(errorMsg: string) {
    this.dialog.open(ErrorDialogComponent, {
      data: errorMsg,
    });
  }
}
<mat-card class="container">
  <mat-toolbar color="primary">
    <span>Projetos</span>
  </mat-toolbar>
  <div class="table" *ngIf="projetos; else loading">
    <table mat-table [dataSource]="projetos" class="mat-elevation-z8">

      <ng-container matColumnDef="name">
        <th mat-header-cell *matHeaderCellDef> NOME </th>
        <td mat-cell *matCellDef="let projetos"> {{  projetos.name }} </td>
      </ng-container>
      <ng-container matColumnDef="description">
        <th mat-header-cell *matHeaderCellDef> Descrição </th>
        <td mat-cell *matCellDef="let projetos"> {{projetos.description}} </td>
      </ng-container>
      <ng-container matColumnDef="createdAt">
        <th mat-header-cell *matHeaderCellDef> Criação </th>
        <td mat-cell *matCellDef="let projetos"> {{projetos.createdAt}} </td>
      </ng-container>
      <ng-container matColumnDef="updatedAt">
        <th mat-header-cell *matHeaderCellDef> Atualização </th>
        <td mat-cell *matCellDef="let projetos"> {{projetos.updatedAt}} </td>
      </ng-container>

      <ng-container matColumnDef="actions">
        <mat-header-cell *matHeaderCellDef>
          <p>AÇÕES </p>
        </mat-header-cell>

        <mat-cell *matCellDef="let projeto">
          <button mat-icon-button color="primary" aria-label="Editar  usuario">
            <mat-icon>edit</mat-icon>
          </button>
          <button mat-icon-button color="warn" aria-label="Remover  Usuario">
            <mat-icon>delete</mat-icon>
          </button>
        </mat-cell>

      </ng-container>
      <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
      <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>
    </table>
  </div>

  <ng-template #loading>
    <div class="loading-spinner">
      <mat-spinner></mat-spinner>
    </div>
  </ng-template>

</mat-card>
